import { useParams } from "react-router";
import Mvideo from "./Mvideo";
import { useState } from "react";
import { useEffect } from "react";
const MMvideo = () => {
  let { id } = useParams();
  const [data, setdata] = useState([]);
  useEffect(() => {
    fetch(`https://netflix-ankit.ankitzxi05.repl.co/${id}`)
      .then((res) => {
        return res.json();
      })
      .then((data2) => {
        let arr = [];
        arr.push(<Mvideo link={data2.url} />);
        setdata(arr);
      });
  });
  return <>{data}</>;
};

export default MMvideo;
